import React from "react";

const SinglePokemon = ({ imgUrl, name, number, type1, type2 }) => {
  return (
    <div>
      <img src={imgUrl} />
      <h2>{name}</h2>
      <br />
      <b>Name</b>
      {name}
      <br />
      <b>Number</b>
      {number}
      <br />
      <b>Type 1:</b>
      {type1}
      <br />
      <b>Type 2:</b>
      {type2}
      <br />
    </div>
  );
};

export default SinglePokemon;
